// React
import React, { Fragment } from "react";

// Third part
import { Table } from "antd";
import { DeleteFilled, EditFilled } from "@ant-design/icons";
import moment from "moment";

// Funtional Component
const DishTable = ({ data, deleteItem, editItem }) => {
  return (
    // <table class="table">
    //   <thead>
    //     <tr>
    //       <th scope="col">Name</th>
    //       <th scope="col">Price</th>
    //       <th scope="col">Date</th>
    //     </tr>
    //   </thead>
    //   <tbody>
    //     <tr>
    //       {data.map((d) => (
    //         <Fragment>
    //           <th scope="row">{d.name}</th>
    //           <th scope="row">{d.price}</th>
    //           <th scope="row">{moment(d.date).format("YYYY MM DD")}</th>
    //         </Fragment>
    //       ))}
    //     </tr>
    //   </tbody>
    // </table>
    <Table
      bordered
      dataSource={data}
      rowKey={(data) => data.id}
      scroll={{ x: 1300 }}
    >
      <Table.Column
        title="Name"
        dataIndex="name"
        sorter={(a, b) => a.name.length - b.name.length}
      />
      <Table.Column
        title="Price"
        dataIndex="price"
        sorter={(a, b) => a.price - b.price}
      />
      <Table.Column
        title="Date"
        render={(text, record) =>
          moment(record.date).format("YYYY[年] MM[月] DD[日]")
        }
        sorter={(a, b) => a.date.length - b.date.length}
      />
      <Table.Column
        width={80}
        fixed="right"
        key={(data) => data.id}
        title="Action"
        render={(text, record) => (
          <Fragment>
            <DeleteFilled
              className="btn btn-danger"
              onClick={() => deleteItem(record.id)}
            />

            <EditFilled
              className="btn btn-primary mt-2"
              onClick={() => editItem(record)}
            />
          </Fragment>
        )}
      />
    </Table>
  );
};

export default DishTable;
